export function mountComponent(
  vm: Component, // 组件实例
  el: ?Element, // 挂载的元素
  hydrating?: boolean // 服务端渲染相关
): Component {
  // 组件的根元素
  vm.$el = el
  if (!vm.$options.render) {
    // 如果不存在 render 方法，会创建一个空的 vnode
    vm.$options.render = createEmptyVNode
    // ...很多代码
  }
  // 触发 beforeMount 生命周期
  callHook(vm, "beforeMount")

  let updateComponent

  updateComponent = () => {
    // vm._render()，生成 vnode，在 instance/render.js 中
    // vm._update()，更新 dom
    vm._update(vm._render(), hydrating)
  }

  // 实例化一个 watcher，会调用 updateComponent，先生成 vnode ，然后调用 update 更新 dom；
  // watcher 的另一个作用是：监听数据的变化
  new Watcher(
    vm,
    updateComponent,
    noop,
    {
      before() {
        if (vm._isMounted && !vm._isDestroyed) {
          callHook(vm, "beforeUpdate")
        }
      }
    },
    true /* isRenderWatcher */
  )
  hydrating = false

  // manually mounted instance, call mounted on self
  // mounted is called for render-created child components in its inserted hook
  // 如果挂载完了，_isMounted 置为true，同时触发mounted钩子
  if (vm.$vnode == null) {
    vm._isMounted = true
    callHook(vm, "mounted")
  }
  return vm
}

