虚拟 DOM
真实的 DOM 元素是很庞大的，频繁的操作 DOM 会影响性能。引入虚拟 DOM，vue 可以计算出最少需要渲染多少组件，并把 DOM 操作次数减少到最少。
同时虚拟 DOM 还可以用于服务端渲染以及跨端使用。
createElemet
vue 中利用 createElemet 方法生成 vnode。定义在src/core/vdom/create-elemenet.js中。
export function createElement(
  context: Component,
  tag: any,
  data: any,
  children: any,
  normalizationType: any,
  alwaysNormalize: boolean
): VNode | Array {
  if (Array.isArray(data) || isPrimitive(data)) {
    normalizationType = children
    children = data
    data = undefined
  }
  if (isTrue(alwaysNormalize)) {
    normalizationType = ALWAYS_NORMALIZE
  }
  return _createElement(context, tag, data, children, normalizationType)
}

export function _createElement(
  context: Component, // vm
  tag?: string | Class | Function | Object, // a, 标签，可以是字符串、组件、函数、对象
  data?: VNodeData, // b, vnode 数据类型，flow/vnode.js 中定义
  children?: any, // c, vnode 的子节点
  normalizationType?: number // d, 子节点的类型，用于区别 render 函数是编译生成还是用户手写生成
): VNode | Array {
  // ...很多代码
  if (normalizationType === ALWAYS_NORMALIZE) {
    // render 函数是用户手写的时候调用，作用是将数组打平为一维数组
    children = normalizeChildren(children)
  } else if (normalizationType === SIMPLE_NORMALIZE) {
    // 当 render 是编译生成的时候调用，作用是将数组打平一层
    children = simpleNormalizeChildren(children)
  }
  let vnode, ns
  if (typeof tag === "string") {
    let Ctor
    ns = (context.$vnode && context.$vnode.ns) || config.getTagNamespace(tag)
    if (config.isReservedTag(tag)) {
      // platform built-in elements
      if (
        process.env.NODE_ENV !== "production" &&
        isDef(data) &&
        isDef(data.nativeOn)
      ) {
        warn(
          `The .native modifier for v-on is only valid on components but it was used on .`,
          context
        )
      }
      // tag 是内置的标签，如 div，创建普通的 vnode
      vnode = new VNode(
        config.parsePlatformTagName(tag),
        data,
        children,
        undefined,
        undefined,
        context
      )
    } else if (
      (!data || !data.pre) &&
      isDef((Ctor = resolveAsset(context.$options, "components", tag)))
    ) {
      // component
      // 如果是已注册的组件名，创建一个组件类型的 vnode
      vnode = createComponent(Ctor, data, context, children, tag)
    } else {
      // unknown or unlisted namespaced elements
      // check at runtime because it may get assigned a namespace when its
      // parent normalizes children
      // 否则创建一个未知标签的 vnode
      vnode = new VNode(tag, data, children, undefined, undefined, context)
    }
  } else {
    // direct component options / constructor
    // 如果 tag 不是字符串，则创建组件类型的 vnode
    vnode = createComponent(tag, data, context, children)
  }
}

